import { IoSearch } from "react-icons/io5";

const SearchBar = () => {
    return(
        <div className="w-full py-2 px-5 flexjustify-center">
            <div className="max-w-[50%]">
                <div className="w-full  items-center p-4 rounded-lg border-2 border-black gap-4">
                    <IoSearch/>
                    <p>Enter Job Title</p>
                </div>
            </div>
        </div>
    )
}

export default SearchBar
